      </div>

      <h3 className="hidders">Choose your Gear and weapons</h3>

      <div className="row form-group">
        <div className="col">
          <label className="">Weapon</label>
          <select
            autoComplete="off"
            className="bg-secondary pl-2 text-white form-control"
            name="group"
          >
            <option value="null"></option>
